-- Gửi Webhook
local Players = game:GetService("Players")
local HttpService = game:GetService("HttpService")

local player = Players.LocalPlayer
local totalUsers = 0 -- Biến tạm thời

-- Hàm xác định executor
local function detectExecutor()
    local executor = "Không xác định"

    -- Mobile
    if fluxus or isfluxus then
        executor = "Fluxus (Mobile)"
    elseif syn then
        executor = "Synapse X (Mobile)"
    elseif KRNL_LOADED then
        executor = "KRNL (Mobile)"
    elseif getgenv and type(getgenv().isdelta) == "function" and getgenv().isdelta() then
        executor = "Delta X (Mobile)"
    elseif getgenv and getgenv().CodeXExecutor then
        executor = "Code X (Mobile)"
    elseif is_arceus_closure or (getrenv and getrenv().isexecutorclosure) then
        executor = "Arceus X (Mobile)"

    -- PC
    elseif getgenv and getgenv().VolcanicExecutor then
        executor = "Volcanic (PC)"
    elseif getgenv and getgenv().SolaraExecutor then
        executor = "Solara (PC)"
    elseif getgenv and getgenv().PotassiumExecutor then
        executor = "Potassium (PC)"
    elseif getgenv and getgenv().AWPExecutor then
        executor = "AWP (PC)"
    elseif getgenv and getgenv().FrostWareExecutor then
        executor = "FrostWare (PC)"
    elseif getgenv and getgenv().VisualExecutor then
        executor = "Visual (PC)"

    -- Fallback
    elseif identifyexecutor and pcall(identifyexecutor) then
        local success, result = pcall(identifyexecutor)
        if success and result then
            executor = result
        end
    elseif getexecutorname and pcall(getexecutorname) then
        local success, result = pcall(getexecutorname)
        if success and result then
            executor = result
        end
    end

    return executor
end

-- 🕒 Lấy thời gian giờ Việt Nam (không cộng thêm vì máy đã UTC+7)
local function getVietnamTime()
    local vn = os.date("*t") -- giờ máy hiện tại (giờ VN nếu máy đúng timezone)
    return string.format("%d/%d/%d %02d:%02d:%02d",
        vn.day, vn.month, vn.year,
        vn.hour, vn.min, vn.sec
    )
end

-- ⏱ Timestamp chuẩn Discord (UTC, không cộng giờ)
local function getDiscordTimestamp()
    return os.date("!%Y-%m-%dT%H:%M:%SZ")
end

-- Gửi thông báo sử dụng script
local function sendUsageNotification()
    totalUsers = totalUsers + 1

    local executorUsed = detectExecutor()
    local timeUsed = getVietnamTime()
    local discordTimestamp = getDiscordTimestamp()

    local embed = {
        title = "📢 **Script Chiriku Main Của Chiriku Roblox ĐZ Real Đã Được Sử Dụng**",
        description = table.concat({
            "👤 Tên người dùng: **" .. player.Name .. "**",
            "🔧 Client Hack: **" .. executorUsed .. "**",
            "🕒 Thời gian: **" .. timeUsed .. "**",
            "👥 Tổng người dùng: **" .. tostring(totalUsers) .. "**"
        }, "\n"),
        color = 0x000000,
        footer = { text = "By: Chiriku Roblox ĐZ Real" },
        timestamp = discordTimestamp
    }

    local data = {
        embeds = { embed }
    }

    local jsonData = HttpService:JSONEncode(data)

    local webhookUrl = "https://discord.com/api/webhooks/1390809633148371079/QHcqnRR8-MnhP0GAySSAmo5ZOEGdQtTgsRXPu1eWHWWyhpCUMpk8FW4Qqj7eB7qDM9Ij"
    local requestFunc = http_request or request or HttpPost or syn.request

    if requestFunc then
        requestFunc({
            Url = webhookUrl,
            Body = jsonData,
            Method = "POST",
            Headers = {
                ["Content-Type"] = "application/json"
            }
        })
    else
        warn("Không tìm thấy hàm request HTTP phù hợp.")
    end
end

sendUsageNotification()
